function Loginform() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  return (
    <>
      <form>
        <div>
          <label htmlFor="email">Email</label>
          <br />
          <input
            type="email"
            name="email"
            id="email"
            autoComplete="off"
            value={email}
          ></input>
        </div>
        <div>
          <label htmlFor="password">password</label>
          <br />
          <input
            type="password"
            name="password"
            id="password"
            autoComplete="off"
            value={password}
          ></input>
        </div>
        <button type="submit">Login</button>
      </form>
    </>
  );
}

export default Loginform;
